const EMPTY_RECORD = {};
const AUTOCOMPLETE_LISTBOX_IGNORE_KEYS = [
  "Control",
  "Shift",
  "Alt",
  "Enter",
  "Home",
  "End",
  "PageUp",
  "PageDown",
  "Meta",
  "Tab",
  "CapsLock"
];
const AUTOCOMPLETE_POPOVER_MARGINS = [0, 1, 1, 1];
const AUTOCOMPLETE_POPOVER_PLACEMENT = "bottom-start";
const AUTOCOMPLETE_POPOVER_FALLBACK_PLACEMENTS = ["top-start"];
export {
  AUTOCOMPLETE_LISTBOX_IGNORE_KEYS,
  AUTOCOMPLETE_POPOVER_FALLBACK_PLACEMENTS,
  AUTOCOMPLETE_POPOVER_MARGINS,
  AUTOCOMPLETE_POPOVER_PLACEMENT,
  EMPTY_RECORD
};
